import react from "react";
import {Link} from "react-router-dom";

function NavLinks() {
  return (
    <div>
      <nav className="nav-links">


        <Link to="/">HOME</Link>

        <Link to="/portfolio">PORTFOLIO</Link>

        <Link to="/contact-me">CONTACT ME</Link>
      </nav>
    </div>
  );
}

export default NavLinks;
